export default class MyTeam extends Component {
    constructor(props){
        super(props)
        this.state = {
            pokemon: {},
            selected: false
        }
    }
    showMyPokemons =() =>{
        return this.props.pokemons.map((pokemon)=>{
            let id = pokemon.name
           return(
            < OriginalPokemons 
                key={id}
                id ={id}
                name ={pokemon.name}
                setSelectedPokemon = {this.setSelectedPokemon}
            />
           )
        })
    }
    render() {
